        "is_frozen": 0,
        "bio": "Experienced Canadian CPA with a deep understanding of Canadian tax laws. My extensive expertise includes preparing corporate tax returns for small and medium-sized enterprises across ALL CANADIAN PROVINCES.\n✅ Licensed CPA from Ontario\n✅ Certified CRA e-filer\n✅ Highly recommended A+++\n\nHere’s how I can assist you:\n\n1️⃣ **Tax Preparation**\n- Corporate Tax (T2)\n- Payroll - T4, T4A, and annual reporting (T4 Summary)\n- Dividends (T5)\n- Sales Taxes (GST, HST, PST, QST)\n- Personal Tax (T1), including self-employed individuals, partnerships, and rental income\n- Non-resident sales tax reporting (GST, HST, PST, QST)\n\n2️⃣ **Tax Planning**\n- Strategic advice on tax-saving measures for small businesses and individuals\n\n3️⃣ **Incorporation and Registration**\n- Establish and incorporate in Canada with the most efficient corporate structure\n- Payroll and sales tax registration (GST, HST, PST, QST)\n- Non-resident sales tax registration (GST, HST, PST, QST)\n\n4️⃣ **CRA Audit and Representation**\n- Effective and efficient representation in CRA audits and appeals\n\nGet in touch to ensure your taxes are handled accurately and efficiently, leaving you stress-free and confident!",
